css:
.github-Project {
  display: flex;
  align-items: center;
  padding: 7px 14px;
  border-bottom: 1px solid #1e1e1e;
}
.github-Project-path {
  flex: 1;
  margin-left: 14px;
}
.github-Project-avatar {
  width: 23px;
  height: 23px;
  border-radius: 2px;
}
.github-Project-lock.btn {
  width: 40px;
  height: 20px;
  padding: 0;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: baseline;
  border: none;
  background-color: transparent;
  background-image: none;
}
.github-Project-lock.btn:active,
.github-Project-lock.btn:hover {
  background-color: transparent;
  background-image: none;
}
.github-Project .icon {
  padding: 0;
  margin: 0;
  line-height: 1em;
  fill: #d6d6d6;
}
.github-Project .icon:hover {
  fill: #F5F5F5;
}
.github-Project .icon.icon-unlock {
  width: 21px;
  height: 17px;
  padding-left: 1px;
}
